	metric_source_g2.clear();
	metric_source_g3.clear();
	metric_source_g4.clear();
	metric_source_g5.clear();
	metric_source_g6.clear();


	metric_source_g1.resize(Tet_N);
	metric_source_g2.resize(Tet_N);
	metric_source_g3.resize(Tet_N);
	metric_source_g4.resize(Tet_N);
	metric_source_g5.resize(Tet_N);
	metric_source_g6.resize(Tet_N); 

