void Deformation::Generate_control_mesh()
{
	int b1, b2, b3, b4, b5, b6, b7, b8, b9, b10;
	for (int i = 0; i < Tet_N; i++)
	{
		b1 = d_.m_Volume_T(i, 0);
		b2 = d_.m_Volume_T(i, 1);
		b3 = d_.m_Volume_T(i, 2);
		b4 = d_.m_Volume_T(i, 3);
		b5 = d_.m_Volume_T(i, 4);
		b6 = d_.m_Volume_T(i, 5);
		b7 = d_.m_Volume_T(i, 6);
		b8 = d_.m_Volume_T(i, 7);
		b9 = d_.m_Volume_T(i, 8);
		b10 = d_.m_Volume_T(i, 9);


		control_T(4 * i, 0) = b1, control_T(4 * i, 1) = b2, control_T(4 * i, 2) = b3, control_T(4 * i, 3) = b7;

		control_T(4 * i + 1, 0) = b2, control_T(4 * i + 1, 1) = b4, control_T(4 * i + 1, 2) = b5, control_T(4 * i + 1, 3) = b8;

		control_T(4 * i + 2, 0) = b3, control_T(4 * i + 2, 1) = b5, control_T(4 * i + 2, 2) = b6, control_T(4 * i + 2, 3) = b9;

		control_T(4 * i + 3, 0) = b7, control_T(4 * i + 3, 1) = b8, control_T(4 * i + 3, 2) = b9, control_T(4 * i + 3, 3) = b10;


	}

	std::cout << "==============  Generate control mesh is OK!  ================" << std::endl;

}




void Deformation::Uniform_Sampling_On_Parameter_Domain()
{
	std::cout << "=========  Parameter_Domain: Uniform sampling !!! ============" << std::endl;
	double reference_x;
	double reference_y;
	double reference_z;

	for (int j = 0; j <= Parameter_Domain_sample_num_xy; j++)
	{
		for (int k = 0; k <= Parameter_Domain_sample_num_xy - j; k++)
		{
			for (int l = 0; l <= Parameter_Domain_sample_num_xy - j - k; l++)
			{

				reference_x = Parameter_Domain_eps + double(j) / Parameter_Domain_sample_num_xy * (1 - 2. * Parameter_Domain_eps);
				reference_y = Parameter_Domain_eps + double(k) / Parameter_Domain_sample_num_xy * (1 - 2. * Parameter_Domain_eps);
				reference_z = Parameter_Domain_eps + double(l) / Parameter_Domain_sample_num_xy * (1 - 2. * Parameter_Domain_eps);


				Fix_reference_x.push_back(reference_x);
				Fix_reference_y.push_back(reference_y);
				Fix_reference_z.push_back(reference_z);

			}


		}

	}

	std::cout << " Fix_reference_x size is: ============= " << Fix_reference_x.size() << " ==================" << std::endl;

}

 

void Deformation::Cal_metric_source_OMP()

{
#pragma omp parallel for schedule(dynamic)
	//#pragma omp parallel for collapse(2)
	for (int i = 0; i < Tet_N; i++)
	{
		int f1 = F0[i];
		int f2 = F1[i];
		int f3 = F2[i];
		int f4 = F3[i];
		int f5 = F4[i];
		int f6 = F5[i];
		int f7 = F6[i];
		int f8 = F7[i];
		int f9 = F8[i];
		int f10 = F9[i];
		 
		double b1x = d_.m_V(f1, 0), b2x = d_.m_V(f2, 0), b3x = d_.m_V(f3, 0), b4x = d_.m_V(f4, 0), b5x = d_.m_V(f5, 0), b6x = d_.m_V(f6, 0), b7x = d_.m_V(f7, 0), b8x = d_.m_V(f8, 0), b9x = d_.m_V(f9, 0), b10x = d_.m_V(f10, 0);
		double b1y = d_.m_V(f1, 1), b2y = d_.m_V(f2, 1), b3y = d_.m_V(f3, 1), b4y = d_.m_V(f4, 1), b5y = d_.m_V(f5, 1), b6y = d_.m_V(f6, 1), b7y = d_.m_V(f7, 1), b8y = d_.m_V(f8, 1), b9y = d_.m_V(f9, 1), b10y = d_.m_V(f10, 1);
		double b1z = d_.m_V(f1, 2), b2z = d_.m_V(f2, 2), b3z = d_.m_V(f3, 2), b4z = d_.m_V(f4, 2), b5z = d_.m_V(f5, 2), b6z = d_.m_V(f6, 2), b7z = d_.m_V(f7, 2), b8z = d_.m_V(f8, 2), b9z = d_.m_V(f9, 2), b10z = d_.m_V(f10, 2);

		 
		std::vector<double> reference_x_vec;
		std::vector<double> reference_y_vec;
		std::vector<double> reference_z_vec;

		if (is_need_self_adaptation_sampling_Parameter_Domain) 
		{
			reference_x_vec = reference_x_On_Volume[i];
			reference_y_vec = reference_y_On_Volume[i];
			reference_z_vec = reference_z_On_Volume[i];

		}
		else
		{
			reference_x_vec = Fix_reference_x;
			reference_y_vec = Fix_reference_y;
			reference_z_vec = Fix_reference_z;
		}

		int reference_sample_num = reference_x_vec.size();

		metric_source_g1[i].resize(reference_sample_num);
		metric_source_g2[i].resize(reference_sample_num);
		metric_source_g3[i].resize(reference_sample_num);
		metric_source_g4[i].resize(reference_sample_num);
		metric_source_g5[i].resize(reference_sample_num);
		metric_source_g6[i].resize(reference_sample_num);

		 


		for (int j = 0; j < reference_sample_num; j++)
		{
			double reference_x = reference_x_vec[j];
			double reference_y = reference_y_vec[j];
			double reference_z = reference_z_vec[j];
			double reference_s = 1. - reference_x - reference_y - reference_z;

			double p00 = 2 * reference_x * (b4x - b2x) + 2 * reference_y * (b5x - b3x) + 2 * reference_z * (b8x - b7x) + 2 * reference_s * (b2x - b1x);
			double p10 = 2 * reference_x * (b4y - b2y) + 2 * reference_y * (b5y - b3y) + 2 * reference_z * (b8y - b7y) + 2 * reference_s * (b2y - b1y);
			double p20 = 2 * reference_x * (b4z - b2z) + 2 * reference_y * (b5z - b3z) + 2 * reference_z * (b8z - b7z) + 2 * reference_s * (b2z - b1z);

			double p01 = 2 * reference_x * (b5x - b2x) + 2 * reference_y * (b6x - b3x) + 2 * reference_z * (b9x - b7x) + 2 * reference_s * (b3x - b1x);
			double p11 = 2 * reference_x * (b5y - b2y) + 2 * reference_y * (b6y - b3y) + 2 * reference_z * (b9y - b7y) + 2 * reference_s * (b3y - b1y);
			double p21 = 2 * reference_x * (b5z - b2z) + 2 * reference_y * (b6z - b3z) + 2 * reference_z * (b9z - b7z) + 2 * reference_s * (b3z - b1z);

			double p02 = 2 * reference_x * (b8x - b2x) + 2 * reference_y * (b9x - b3x) + 2 * reference_z * (b10x - b7x) + 2 * reference_s * (b7x - b1x);
			double p12 = 2 * reference_x * (b8y - b2y) + 2 * reference_y * (b9y - b3y) + 2 * reference_z * (b10y - b7y) + 2 * reference_s * (b7y - b1y);
			double p22 = 2 * reference_x * (b8z - b2z) + 2 * reference_y * (b9z - b3z) + 2 * reference_z * (b10z - b7z) + 2 * reference_s * (b7z - b1z);

			double source_g1 = p00 * p00 + p10 * p10 + p20 * p20;
			double source_g2 = p00 * p01 + p10 * p11 + p20 * p21;
			double source_g3 = p00 * p02 + p10 * p12 + p20 * p22;
			double source_g4 = p01 * p01 + p11 * p11 + p21 * p21;
			double source_g5 = p01 * p02 + p11 * p12 + p21 * p22;
			double source_g6 = p02 * p02 + p12 * p12 + p22 * p22;

			metric_source_g1[i][j] = source_g1;
			metric_source_g2[i][j] = source_g2;
			metric_source_g3[i][j] = source_g3;
			metric_source_g4[i][j] = source_g4;
			metric_source_g5[i][j] = source_g5;
			metric_source_g6[i][j] = source_g6;			 

		}

	}




}

double  Deformation::cubic_root_pow(double& x)
{

	if (x < 0) return -std::pow(abs(x), 1./3);
	return std::pow(x, 1. / 3);
}
	  
double Deformation::mypow(double& x, double& y)
{
	if (x < 0) return -std::pow(abs(x), y);
	return std::pow(x, y);
}
//Find the smallest positive root of a cubic equation of one variable, otherwise it returns positive infinity.
double Deformation::get_smallest_pos_quad_zero(double a, double b, double c, double d)
{
	//std::cout << "====================" << '\n';
	if (std::abs(a) < 1.0e-10)
	{
		a *= 1e6;
		b *= 1e6;
		c *= 1e6;
		d *= 1e6;
	}

	if (std::abs(a) > 1.0e-10) 
	{
		double A = b * b - 3 * a * c;

		double B = b * c - 9 * a * d;

		double C = c * c - 3 * b * d;


		double detel = B * B - 4 * A * C;
		//printf(" detel is :  %.8f ", detel);
		//std::cout << '\n';

		double t1, t2, t3;

		if (abs(A) < 1e-30 && abs(B) < 1e-30)
		{
			t1 = -b / a / 3;
			//t2 = t1; 
			//t3 = t1;
			if (t1 > 0)
			{
			//	std::cout << "1" << std::endl;
				return t1;
			}
			//std::cout << "2" << std::endl;
			return  INFINITY;
		}
		else if (detel > 1e-30)
		{
			double Y1 = A * b + 3 * a * (-B + sqrt(detel)) / 2;
			double Y2 = A * b + 3 * a * (-B - sqrt(detel)) / 2;
			//printf(" Y1 is :  %.8f , Y2 is :  %.8f ", Y1, Y2);
			//std::cout << '\n';

			if (abs(Y1 - Y2) < 1e-30)
			{
				t1 = (-b - (cubic_root_pow(Y1) + cubic_root_pow(Y2))) / a / 3;
				//t2 = t1;
				//t3 = t1;
				if (t1 > 0)
				{
				//	std::cout << "3" << std::endl;

					return t1;
				}
				//std::cout << "4" << std::endl;

				return  INFINITY;

			}
			else 
			{
				//printf(" 1 is :  %.8f , 2 is :  %.8f ", cubic_root_pow(Y1), cubic_root_pow(Y2));
				//std::cout << '\n';

				t1 = (-b - (cubic_root_pow(Y1) + cubic_root_pow(Y2))) / a / 3;
				if (t1 > 0)
				{
					//std::cout << "5" << std::endl;
					return t1;
				}
				//std::cout << "6" << std::endl;
				//printf(" root is :  %.8f ", t1);
				//std::cout << '\n';

				return  INFINITY;

			}


		}
		else if (abs(detel) < 1e-30) 
		{
			double K = B / A;
			t1 = -b / a + K;
			t2 = -K / 2;
			t3 = t2;

			if (t1 > 0 && t2 > 0)
			{
				//std::cout << "7" << std::endl;

				return min(t1, t2);
			}
			else if (t1 < 0 && t2 < 0) 
			{
				//std::cout << "8" << std::endl;

				return  INFINITY;

			}
			else 
			{
				//std::cout << "9" << std::endl;

				return max(t1, t2);
			}

		}
		else 
		{
			double T = (2 * A * b - 3 * a * B) / (2 * A * sqrt(A));

			 
			double S = acos(fmin(fmax(T, -(1.0 - 1e-50)), 1.0 - 1e-50));

			t1 = (-b - 2 * sqrt(A) * cos(S / 3)) / (3 * a);
			t2 = (-b + sqrt(A) * (cos(S / 3) + sqrt(3.0) * sin(S / 3))) / (3 * a);
			t3 = (-b + sqrt(A) * (cos(S / 3) - sqrt(3.0) * sin(S / 3))) / (3 * a);

			 
			double t = INFINITY;
			if (t1 > 0 && t1 < t)t = t1;
			if (t2 > 0 && t2 < t)t = t2;
			if (t3 > 0 && t3 < t)t = t3;
			//std::cout << "10" << std::endl;
			//printf(" t1 is :  %.8f , t2 is :  %.8f , t3 is :  %.8f", t1, t2, t3);

			return t;
		}



	}
	else 
	{
	    //std::cout << "11" << std::endl;

		return get_smallest_pos_quad_zero(b, c, d);

	}

	 
}

//Find the smallest positive root of a quadratic equation of one variable, otherwise return positive infinity
double Deformation::get_smallest_pos_quad_zero(double a, double b, double c)
{
	double t1, t2;
	if (std::abs(a) < 1.0e-10)
	{
		a *= 1e6;
		b *= 1e6;
		c *= 1e6;
	}
	if (std::abs(a) > 1.0e-10)
	{
		double delta_in = pow(b, 2) - 4 * a * c;
		if (delta_in <= 0)
		{
			//std::cout << "delta_in <0" << std::endl;
			return INFINITY;
		}

		double delta = sqrt(delta_in); // delta >= 0
		if (b >= 0) // avoid subtracting two similar numbers
		{
			double bd = -b - delta;
			t1 = 2 * c / bd;
			t2 = bd / (2 * a);
		}
		else
		{
			double bd = -b + delta;
			t1 = bd / (2 * a);
			t2 = (2 * c) / bd;
		}

		assert(std::isfinite(t1));
		assert(std::isfinite(t2));

		if (a < 0) std::swap(t1, t2); // make t1 > t2
									  // return the smaller positive root if it exists, otherwise return infinity
		if (t1 > 0)
		{
			return t2 > 0 ? t2 : t1;
		}
		else
		{
			return INFINITY;
		}
	}
	else
	{
		if (b == 0) return INFINITY; // just to avoid divide-by-zero
		t1 = -c / b;
		return t1 > 0 ? t1 : INFINITY;
	}

}

